import React from "react";
import {Link} from "react-bootstrap";
class Navbar extends React.Component{
    render(){
        return(
            <nav>
                <div className="main-wrapper"> 
                           
                   <span className="logo">
                       NewsBix
                   </span>
                  
                   <ul className="items">
                       <li>
                       <i class="fab fa-searchengin" style={{fontSize:"20px"}}></i>
                       </li>
                       <li>
                            <a href="/bookmarks" style={{color:"white",textDecoration:"none"}}>
                                Bookmarks
                            </a>
                               

                           
                       </li>
                   </ul>
                </div>
            </nav>
        );
    }
}

export default Navbar;
